import styled from 'styled-components';

export const StyledHeader = styled.div`
    flex: calc(25% - 25px);
    max-width: calc(25% - 25px);
`;

export const Wrapper = styled.div`
    display: flex;
    flex-wrap: wrap;
    flex-direction: row;
    justify-content: space-evenly;
`;
